import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion';
import Logo from './Logo';

export default function Footer() {
  return (
    <footer className="relative z-50 bg-gray-900 text-gray-300 pt-16 pb-8 overflow-hidden">
      <div className="container mx-auto px-4">
        {/* Logo Section */}
        <div className="flex justify-center mb-12">
          <motion.div
            className="w-32 md:w-40"
            initial={{ scale: 0.9, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ duration: 0.5 }}
            whileHover={{ rotate: 5, scale: 1.05 }}
          >
            <Logo color="#FFA726" />
          </motion.div>
        </div>

        {/* Main Footer Content */}
        <div className="grid gap-8 md:grid-cols-3 mb-12 text-center md:text-left">
          {/* Contact Section */}
          <div>
            <h3 className="text-white text-xl font-bold mb-4">தொடர்பு</h3>
            <div className="space-y-2">
              <a href="mailto:eazhisaie@gmail.com" className="flex items-center justify-center md:justify-start hover:text-white transition-colors">
                <svg className="w-5 h-5 mr-2" fill="currentColor" viewBox="0 0 20 20">
                  <path d="M2.003 5.884L10 9.882l7.997-3.998A2 2 0 0016 4H4a2 2 0 00-1.997 1.884z" />
                  <path d="M18 8.118l-8 4-8-4V14a2 2 0 002 2h12a2 2 0 002-2V8.118z" />
                </svg>
                eazhisaie@gmail.com
              </a>
              <a href="tel:+94705738946" className="flex items-center justify-center md:justify-start hover:text-white transition-colors">
                <svg className="w-5 h-5 mr-2" fill="currentColor" viewBox="0 0 20 20">
                  <path d="M2 3a1 1 0 011-1h2.153a1 1 0 01.986.836l.74 4.435a1 1 0 01-.54 1.06l-1.548.773a11.037 11.037 0 006.105 6.105l.774-1.548a1 1 0 011.059-.54l4.435.74a1 1 0 01.836.986V17a1 1 0 01-1 1h-2C7.82 18 2 12.18 2 5V3z" />
                </svg>
                +94 70 5 738946
              </a>
            </div>
          </div>

          {/* Quick Links */}
          <div>
            <h3 className="text-white text-xl font-bold mb-4">இணைப்பு</h3>
            <nav className="space-y-2">
              <Link to="/about" className="block hover:text-white transition-colors">பற்றி</Link>
              <Link to="/courses" className="block hover:text-white transition-colors">படிப்புகள்</Link>
              <Link to="/events" className="block hover:text-white transition-colors">செய்தி மற்றும் நிகழ்வுகள்</Link>
            </nav>
          </div>

          {/* Social Links with hover animation */}
          <div>
            <h3 className="text-white text-xl font-bold mb-4">பின்தொடரவும்</h3>
            <div className="flex justify-center md:justify-start space-x-6">
              {[
                { label: 'Facebook', path: '#', icon: 'M18.77,7.46H14.5V5.9c0-.86.72-1.58,1.58-1.58h2.7V0H14.5C11.13,0,8.38,2.75,8.38,6.12v1.34H4.11v4.76h4.27V24h6.12V12.22h4.27l0-4.76Z' },
                { label: 'Twitter', path: '#', icon: 'M23.954 4.569c-.885.389-1.83.654-2.825.775-...'}, 
                { label: 'Instagram', path: '#', icon: 'M12 2.163c3.204 0 3.584.012 4.85.07...'},
                { label: 'LinkedIn', path: '#', icon: 'M19 0h-14c-2.761 0-5 2.239-5 5v14...'}
              ].map((item, idx) => (
                <motion.a
                  key={idx}
                  href={item.path}
                  target="_blank"
                  rel="noopener noreferrer"
                  aria-label={item.label}
                  whileHover={{ scale: 1.2, rotate: 8 }}
                  whileTap={{ scale: 0.9 }}
                  className="text-gray-400 hover:text-[#FFA726] transition-colors"
                >
                  <svg className="w-7 h-7" fill="currentColor" viewBox="0 0 24 24">
                    <path d={item.icon} />
                  </svg>
                </motion.a>
              ))}
            </div>
          </div>
        </div>

        {/* Bottom Section */}
        <div className="border-t border-gray-800 pt-8">
          <div className="flex flex-col md:flex-row justify-between items-center text-center md:text-left">
            <p className="text-sm">பதிப்புரிமை © 2025 நிறுவனம் - <a href="https://neirahtech.com/" className="hover:text-white transition-colors">நெய்ராஹ்டெக் மூலம் இயக்கப்படுகிறது.</a></p>
            <div className="mt-4 md:mt-0 space-x-4 text-sm">
              <Link to="/privacy-policy" className="hover:text-white transition-colors">தனியுரிமைக் கொள்கை</Link>
              <Link to="/terms" className="hover:text-white transition-colors">பயன்பாட்டு விதிமுறைகள்</Link>
            </div>
          </div>
        </div>
      </div>
    </footer>
  );
}
